int PrintArray(int Array[], int length)
{
	int value = 1;
	int i;
	for (i = 1; i <= length; i++)
	{
		value = i;
		if (value < 0)
		{
			value = -i;
			printf("%d ", value);
		}
		printf("%d ", value);
	}
	return value;
}

