// Author: Zara Zoll
// this function uses two inputs, an array of intergers
// and an integer that indicates the number of elements in the array
// the function return the number of values in the array that are equal to zero.
void PrintArray(int array[], int number) {
    int i = 0; //initialise the loop
        
    while(i < number) { //condition 
            printf("%d", array[i]);

            if (i < number - 1) { //this adds space after each element except for da last one
                printf(" ");
            }
            
            i++; //increment 
        }
        printf("\n");
}
